import React from "react";
import "./css-components/slide-show.css";

function SlideShow() {
  return (
    <div className="slider">
      <a className="slide-but-1" href="#slide-1">
        1
      </a>
      <a className="slide-but-1" href="#slide-2">
        2
      </a>

      <div className="slides">
        <div id="slide-1">1</div>
        <div id="slide-2">2</div>
      </div>
    </div>
  );
}

export default SlideShow;
